import React from "react";
import "../css/Profile.css"; // Import the CSS file

const Profile = () => {
  const user = {
    name: "Eileen",
    photo: "https://via.placeholder.com/150", // Placeholder image
    trips: [
      { id: 1, title: "Road Trip to Yosemite", date: "2024-10-15" },
      { id: 2, title: "Weekend in San Francisco", date: "2024-11-01" },
    ],
  };

  return (
    <div className="profile">
      <div className="profile-header">
        <img src={user.photo} alt="User Profile" className="profile-photo" />
        <h2 className="profile-name">{user.name}</h2>
      </div>
      <div className="profile-trips">
        <h3>Your Trips</h3>
        <ul className="trips-list">
          {user.trips.map((trip) => (
            <li key={trip.id} className="trip-item">
              <h4>{trip.title}</h4>
              <p>{trip.date}</p>
            </li>
          ))}
        </ul>
        <button className="add-trip-button">Add New Trip</button>
      </div>
    </div>
  );
};

export default Profile;
